//Var mapping part
function chordVarMapper(fileName){
  mappedVar = fileName.map(function (d) {
    return {
      source: {
        id: d.source,
        start: parseInt(d.source_start) - 2000,
        end: parseInt(d.source_end) + 2000},
        target: {
          id: d.target,
          start: parseInt(d.target_start) - 2000,
          end: parseInt(d.target_end) + 2000
        }
      }
    }
    );
  return mappedVar;
}
function heatmapVarMapper(fileName){
  var mappedVar =fileName.map(function(d) {
    return {
      block_id: d.chromosome,
      start: parseInt(d.start),
      end: parseInt(d.end),
      value: parseFloat(d.value)
    };
  });
  return mappedVar;
}
